var __index = {"config":{"lang":["en","zh"],"separator":"[\\s\\u200b\\u3000\\-\u3001\u3002\uff0c\uff0e\uff1f\uff01\uff1b]+","pipeline":["stemmer","stopWordFilter","trimmer"]},"docs":[{"location":"index.html","title":"Open Tech Garage","text":""},{"location":"index.html#_1","title":"\u5c08\u6848\u7c21\u4ecb","text":"<p>\u958b\u653e\u79d1\u6280\u8eca\u5eab\uff08Open Tech Garage\uff09\u662f\u4e00\u500b\u805a\u7126\u65bc\u8a55\u4f30\u3001\u5206\u6790\u8207\u6e2c\u8a66\u591a\u7a2e\u958b\u6e90\u8edf\u9ad4\u5de5\u5177\u7684\u5c08\u6848\uff0c\u76ee\u6a19\u5728\u65bc\u63d0\u4f9b\u900f\u660e\u4e14\u5ba2\u89c0\u7684\u8cc7\u8a0a\uff0c\u5e6b\u52a9\u7528\u6236\u2014\u5c24\u5176\u662f\u5c0d\u5b89\u5168\u8207\u96b1\u79c1\u6709\u9700\u6c42\u7684\u4f7f\u7528\u8005\u2014\u505a\u51fa\u660e\u667a\u7684\u9078\u64c7\u3002\u5c08\u6848\u7531\u958b\u653e\u6587\u5316\u57fa\u91d1\u6703 (OCF) \u8207 \u4f0d\u65af\u7279\u7406\u5de5\u5b78\u9662 (WPI) IQP \u8a08\u756b\u5171\u540c\u63a8\u52d5\uff0c\u4e26\u7372\u5f97 APC \u652f\u6301\uff0c\u529b\u6c42\u7d50\u5408\u5b78\u8853\u7814\u7a76\u8207\u5be6\u52d9\u7d93\u9a57\uff0c\u6253\u9020\u4e00\u500b\u958b\u6e90\u5de5\u5177\u4f7f\u7528\u8207\u63a8\u5ee3\u7684\u5e73\u53f0\u3002</p>"},{"location":"index.html#_2","title":"\u6211\u5011\u7684\u9858\u666f\u8207\u76ee\u6a19","text":"<ul> <li>\u5168\u9762\u4e14\u56b4\u8b39\u7684\u8a55\u6e2c\uff1a \u5305\u62ec\u529f\u80fd\u6027\u3001\u5b89\u5168\u6027\u3001\u96b1\u79c1\u4fdd\u969c\u3001\u4f7f\u7528\u8005\u9ad4\u9a57\u53ca\u6280\u8853\u7dad\u8b77\u7b49\u591a\u9762\u5411\u5206\u6790\u3002</li> <li>\u964d\u4f4e\u4f7f\u7528\u9580\u6abb\uff1a \u900f\u904e\u5be6\u969b\u5b89\u88dd\u6e2c\u8a66\uff0c\u63d0\u4f9b\u660e\u78ba\u7684\u300c\u5b89\u88dd\u96e3\u6613\u5ea6\u8a55\u4f30\u300d\u548c\u300c\u786c\u9ad4/\u8edf\u9ad4\u9700\u6c42\u300d\uff0c\u5e6b\u52a9\u4e0d\u540c\u6280\u8853\u80cc\u666f\u7684\u7528\u6236\u7406\u89e3\u662f\u5426\u9069\u5408\u4f7f\u7528\u8a72\u5de5\u5177\u3002</li> <li>\u6301\u7e8c\u66f4\u65b0\u8207\u7dad\u8b77\uff1a \u96a8\u8457\u6280\u8853\u6f14\u9032\u8207\u793e\u7fa4\u56de\u994b\uff0c\u6301\u7e8c\u8abf\u6574\u8207\u5b8c\u5584\u8a55\u6e2c\u6a19\u6e96\u8207\u5167\u5bb9\u3002</li> <li>\u4fc3\u9032\u958b\u6e90\u6587\u5316\u8207\u5408\u4f5c\uff1a \u9f13\u52f5\u793e\u7fa4\u5171\u5275\uff0c\u64f4\u5927\u5168\u7403\u958b\u6e90\u8edf\u9ad4\u7684\u5f71\u97ff\u529b\u548c\u751f\u614b\u7cfb\u7d71\u3002</li> </ul>"},{"location":"index.html#_3","title":"\u5c08\u6848\u7279\u8272","text":"<ul> <li>\u5b89\u88dd\u96e3\u6613\u5ea6\u8207\u8a2d\u5099\u9700\u6c42\u6e2c\u8a66\uff1a \u6211\u5011\u89aa\u81ea\u6e2c\u8a66\u5404\u985e\u5de5\u5177\u7684\u5b89\u88dd\u6d41\u7a0b\uff0c\u8a55\u4f30\u6240\u9700\u786c\u9ad4\u8a2d\u5099\u3001\u7cfb\u7d71\u74b0\u5883\u3001\u7db2\u8def\u689d\u4ef6\u8207\u6280\u8853\u9580\u6abb\uff0c\u4e26\u4ee5\u6e05\u695a\u6613\u61c2\u7684\u65b9\u5f0f\u5448\u73fe\u7d66\u7528\u6236\u3002\u76ee\u7684\u662f\u8b93\u6280\u8853\u529b\u8f03\u4f4e\u7684\u7528\u6236\uff0c\u4e5f\u80fd\u5728\u63a1\u7528\u524d\u5145\u5206\u4e86\u89e3\u8a72\u5de5\u5177\u662f\u5426\u7b26\u5408\u81ea\u8eab\u689d\u4ef6\uff0c\u907f\u514d\u8e29\u96f7\u4e26\u63d0\u5347\u63a1\u7528\u6210\u529f\u7387\u3002</li> <li>\u591a\u7dad\u5ea6\u7684\u5de5\u5177\u5206\u985e\uff1a \u4f9d\u61c9\u7528\u9818\u57df\u5982\u901a\u4fe1\u3001\u52a0\u5bc6\u3001\u96b1\u79c1\u4fdd\u8b77\u3001\u6578\u64da\u5206\u6790\u7b49\uff0c\u8b93\u4f7f\u7528\u8005\u8f15\u9b06\u627e\u5230\u76ee\u6a19\u5de5\u5177\u3002</li> <li>\u5b8c\u6574\u7684\u4f7f\u7528\u8aaa\u660e\u8207\u6307\u5f15\uff1a \u5f9e\u5165\u9580\u6559\u5b78\u3001\u64cd\u4f5c\u624b\u518a\u3001\u5e38\u898b\u554f\u984c\u89e3\u7b54\u5230\u90e8\u7f72\u6d41\u7a0b\uff0c\u63d0\u4f9b\u4e0d\u540c\u5c64\u6b21\u7684\u652f\u6301\u6587\u4ef6\u3002</li> <li>\u793e\u7fa4\u4e92\u52d5\u8207\u8ca2\u737b\u6a5f\u5236\uff1a \u6b61\u8fce\u4f7f\u7528\u8005\u63d0\u4ea4\u5de5\u5177\u63a8\u85a6\u3001\u4f7f\u7528\u5fc3\u5f97\u3001\u8a55\u6e2c\u5efa\u8b70\uff0c\u5171\u540c\u63d0\u5347\u8cc7\u6599\u54c1\u8cea\u3002</li> </ul>"},{"location":"index.html#_4","title":"\u9069\u7528\u5c0d\u8c61","text":"<ul> <li>\u5c0d\u5b89\u5168\u3001\u96b1\u79c1\u6709\u9700\u6c42\u7684\u500b\u4eba\u4f7f\u7528\u8005</li> <li>\u6280\u8853\u80cc\u666f\u591a\u5be1\u4e0d\u4e00\u7684\u975e\u71df\u5229\u7d44\u7e54\u8207\u6c11\u9593\u5718\u9ad4</li> <li>\u8edf\u9ad4\u958b\u767c\u8005\u8207\u5b89\u5168\u7814\u7a76\u4eba\u54e1</li> <li>\u6559\u80b2\u8207\u5b78\u8853\u7814\u7a76\u6a5f\u69cb</li> <li>\u653f\u5e9c\u6216\u516c\u5171\u670d\u52d9\u76f8\u95dc\u55ae\u4f4d</li> </ul>"},{"location":"index.html#_5","title":"\u5982\u4f55\u53c3\u8207\u5c08\u6848","text":"<p>\u5728 GitHub \u63d0\u4ea4\u5de5\u5177\u63a8\u85a6\u6216\u8a55\u6e2c\u8cc7\u6599\u3001\u5206\u4eab\u5be6\u969b\u4f7f\u7528\u7d93\u9a57\u8207\u56de\u994b\u3001\u5354\u52a9\u64b0\u5beb\u6216\u5b8c\u5584\u64cd\u4f5c\u6307\u5357\u8207\u5b89\u88dd\u6559\u5b78\u3001\u53c3\u8207\u793e\u7fa4\u8a0e\u8ad6\u8207\u63a8\u5ee3\u6d3b\u52d5\u3002\u8a73\u7d30\u8ca2\u737b\u6d41\u7a0b\u8acb\u53c3\u95b1\u5c08\u6848\u7684 Contributing \u6587\u4ef6\u3002</p>"},{"location":"index.html#_6","title":"\u5de5\u5177\u8a55\u4f30\u5206\u6790","text":""},{"location":"index.html#_7","title":"\u4e3b\u984c\u6bd4\u8f03\u5831\u544a","text":""},{"location":"story.html","title":"\u6578\u4f4d\u884c\u52d5\uff0c\u4e5f\u9700\u8981\u9632\u8b77\uff1a","text":""},{"location":"story.html#_2","title":"\u5f9e\u4e00\u5834\u5584\u610f\u5354\u52a9\uff0c\u770b\u898b\u6578\u4f4d\u98a8\u96aa\u7684\u5168\u8c8c","text":""},{"location":"story.html#_3","title":"\u770b\u4f3c\u5e73\u51e1\u7684\u5354\u52a9\uff0c\u5176\u5be6\u6f5b\u85cf\u98a8\u96aa","text":"<p>\u5c0f\u660e\u662f T \u570b\u975e\u71df\u5229\u7d44\u7e54\u7684\u5de5\u4f5c\u8005\u3002\u67d0\u5929\uff0c\u66fe\u7d93\u7684\u5408\u4f5c\u5c0d\u8c61\u8a62\u554f\u4ed6\uff0c\u80fd\u5426\u5354\u52a9\u6771\u5357\u4e9e\u67d0\u570b\u7684\u6c11\u9593\u5718\u9ad4\u7a81\u7834\u56b4\u91cd\u7684\u7db2\u8def\u5c01\u9396\uff0c\u8b93\u7576\u5730\u4eba\u6c11\u80fd\u81ea\u7531\u63a5\u89f8\u5916\u754c\u8cc7\u8a0a\u3002\u96d6\u7136\u4ed6\u4e0d\u662f\u6280\u8853\u5c08\u5bb6\uff0c\u4f46\u71b1\u8877\u65bc\u63d0\u4f9b\u8cc7\u6599\u6574\u7406\u3001\u8a13\u7df4\u6559\u6750\u8207\u67b6\u8a2d\u7db2\u7ad9\u7684\u652f\u63f4\u3002</p> <p>\u67d0\u5929\uff0c\u5c0f\u660e\u7528\u81ea\u5df1\u5bb6\u88e1\u7684\u666e\u901a\u7db2\u8def\u9023\u7dda\uff0c\u4f7f\u7528\u4e00\u822c\u700f\u89bd\u5668\u767b\u5165\u514d\u8cbb\u7db2\u7ad9\u5e73\u53f0\uff0c\u5c07\u5408\u4f5c\u5925\u4f34\u63d0\u4f9b\u7684\u5167\u5bb9\u4e0a\u50b3\uff0c\u5efa\u7acb\u4e86\u4e00\u500b\u81e8\u6642\u7db2\u7ad9\u3002\u7531\u65bc\u6c92\u6709\u4f7f\u7528\u533f\u540d\u700f\u89bd\u5668\uff0c\u4ed6\u7684\u771f\u5be6 IP \u4f4d\u5740\u3001\u9023\u7dda\u6642\u9593\u548c\u64cd\u4f5c\u7d00\u9304\uff0c\u5168\u90e8\u90fd\u66b4\u9732\u5728\u76e3\u63a7\u7cfb\u7d71\u9762\u524d\u3002</p> <p>\u5e7e\u5929\u5f8c\uff0c\u7db2\u7ad9\u88ab\u5c01\u9396\uff0c\u5408\u4f5c\u5925\u4f34\u7684\u5e33\u865f\u4e5f\u906d\u505c\u7528\uff0c\u751a\u81f3\u6709\u4eba\u56e0\u6b64\u88ab\u653f\u5e9c\u50b3\u559a\u8cea\u554f\u800c\u5931\u806f\u3002\u5c0f\u660e\u9707\u9a5a\u65bc\u81ea\u5df1\u7684\u4e0d\u614e\uff0c\u5bb3\u5f97\u5925\u4f34\u9677\u5165\u5371\u96aa\u3002</p> <p>\u5982\u679c\u7576\u521d\u4ed6\u4f7f\u7528\u4e86 Tor Browser\uff0c\u900f\u904e\u591a\u5c64\u52a0\u5bc6\u8def\u7531\u548c\u533f\u540d\u6d41\u91cf\u8f49\u767c\uff0c\u4ed6\u7684\u8eab\u4efd\u548c\u4f4d\u7f6e\u5c31\u4e0d\u6703\u88ab\u8f15\u6613\u63ed\u9732\u3002Tor \u80fd\u6709\u6548\u963b\u65b7\u653f\u5e9c\u6216\u7db2\u8def\u4f9b\u61c9\u5546\u5f9e\u7db2\u8def\u6d41\u91cf\u4e2d\u5224\u65b7\u4f7f\u7528\u8005\u8eab\u4efd\uff0c\u4fdd\u8b77\u4ed6\u4e0d\u88ab\u8ffd\u8e64\u3002\u9019\u662f\u666e\u901a\u700f\u89bd\u5668\u7121\u6cd5\u505a\u5230\u7684\u95dc\u9375\u9632\u8b77\u3002</p> <ul> <li>\u89d2\u8272\uff1a\u4f5c\u70ba\u4e00\u500b\u975e\u71df\u5229\u7d44\u7e54\u5de5\u4f5c\u4eba\u54e1\uff0c  </li> <li>\u9700\u6c42\uff1a\u6211\u9700\u8981\u4e00\u500b\u5b89\u5168\u3001\u533f\u540d\u7684\u65b9\u5f0f\u4f86\u5206\u4eab\u6a5f\u654f\u8cc7\u8a0a\uff0c  </li> <li>\u7406\u7531\uff1a\u4ee5\u4fbf\u4fdd\u8b77\u6211\u548c\u6211\u7684\u5408\u4f5c\u5925\u4f34\u4e0d\u88ab\u8ffd\u8e64\u6216\u5831\u5fa9\u3002</li> </ul>"},{"location":"story.html#_4","title":"\u4e00\u500b\u81e8\u6642\u7db2\u7ad9\uff0c\u66b4\u9732\u4e86\u5f7c\u6b64\u7684\u771f\u5be6\u8eab\u4efd","text":"<p>\u4e8b\u4ef6\u767c\u751f\u5f8c\uff0c\u5c0f\u660e\u5617\u8a66\u63d0\u9ad8\u5b89\u5168\u610f\u8b58\uff0c\u958b\u59cb\u6559\u5c0e\u5718\u968a\u4f7f\u7528\u533f\u540d\u5de5\u5177\u548c\u52a0\u5bc6\u5206\u4eab\u5e73\u53f0\uff0c\u4f46\u4ed6\u81ea\u5df1\u4ecd\u72af\u4e86\u932f\u3002</p> <p>\u4e00\u6b21\uff0c\u70ba\u65b9\u4fbf\u6771\u5357\u4e9e\u670b\u53cb\uff0c\u4ed6\u76f4\u63a5\u5728\u4e00\u822c\u901a\u8a0a\u8edf\u9ad4\u8cbc\u51fa Google \u96f2\u7aef\u786c\u789f\u7684\u9023\u7d50\uff0c\u4e14\u8a2d\u5b9a\u70ba\u300c\u6709\u9023\u7d50\u8005\u7686\u53ef\u6aa2\u8996\u300d\uff0c\u672a\u505a\u52a0\u5bc6\u4fdd\u8b77\u3002</p> <p>\u6c92\u60f3\u5230\uff0c\u9019\u4e9b\u9023\u7d50\u5bb9\u6613\u88ab\u76e3\u63a7\u7cfb\u7d71\u622a\u53d6\uff0c\u9023\u7d50\u5167\u5bb9\u751a\u81f3\u53ef\u80fd\u88ab\u641c\u5c0b\u5f15\u64ce\u6536\u9304\u3002\u5e7e\u5929\u5f8c\uff0c\u5c0f\u660e\u6536\u5230\u4e86\u533f\u540d\u5a01\u8105\u4fe1\uff0c\u8b66\u544a\u4ed6\u505c\u6b62\u5354\u52a9\u3002</p> <p>\u70ba\u907f\u514d\u985e\u4f3c\u60c5\u6cc1\u518d\u6b21\u767c\u751f\uff0c\u4ed6\u958b\u59cb\u4f7f\u7528 PrivateBin\uff0c\u4e00\u6b3e\u80fd\u5728\u767c\u9001\u524d\u52a0\u5bc6\u6587\u5b57\u548c\u9023\u7d50\u7684\u5de5\u5177\uff0c\u53ea\u6709\u64c1\u6709\u5bc6\u78bc\u7684\u4eba\u80fd\u8b80\u53d6\u5167\u5bb9\uff0c\u9084\u80fd\u8a2d\u5b9a\u81ea\u52d5\u522a\u9664\uff0c\u6709\u6548\u9632\u6b62\u654f\u611f\u8cc7\u8a0a\u5916\u6d29\u3002</p> <ul> <li>\u89d2\u8272\uff1a\u4f5c\u70ba\u4e00\u500b\u975e\u71df\u5229\u7d44\u7e54\u5de5\u4f5c\u4eba\u54e1\uff0c  </li> <li>\u9700\u6c42\uff1a\u6211\u9700\u8981\u5b89\u5168\u7684\u65b9\u5f0f\u4f86\u5206\u4eab\u548c\u4fdd\u8b77\u6a5f\u654f\u8cc7\u8a0a\uff0c  </li> <li>\u7406\u7531\uff1a\u4ee5\u514d\u6211\u7684\u6d3b\u52d5\u548c\u5408\u4f5c\u5925\u4f34\u7684\u5b89\u5168\u53d7\u5230\u5a01\u8105\u3002</li> </ul>"},{"location":"story.html#_5","title":"\u771f\u6b63\u5b89\u5168\u7684\u5c0d\u8a71\uff0c\u5f9e\u9078\u5c0d\u901a\u8a0a\u5de5\u5177\u958b\u59cb","text":"<p>\u96a8\u8457\u60c5\u52e2\u5347\u9ad8\uff0c\u5c0f\u660e\u610f\u8b58\u5230\u904e\u53bb\u4f7f\u7528\u7684\u901a\u8a0a\u8edf\u9ad4\u4e5f\u5b58\u5728\u8cc7\u5b89\u98a8\u96aa\u3002\u96d6\u7136\u4ed6\u7528 Tor \u4fdd\u8b77\u700f\u89bd\u5b89\u5168\uff0c\u901a\u8a0a\u5167\u5bb9\u537b\u4ecd\u53ef\u80fd\u88ab\u622a\u53d6\u3002</p> <p>\u6536\u5230\u670b\u53cb\u8b66\u544a\u6709\u964c\u751f\u865f\u78bc\u8a66\u5716\u5075\u6e2c\u4ed6\u5011\u901a\u8a0a\u8a18\u9304\u5f8c\uff0c\u5c0f\u660e\u958b\u59cb\u5c0b\u627e\u5b89\u5168\u901a\u8a0a\u5de5\u5177\uff0c\u6700\u5f8c\u9078\u64c7\u4e86 Signal\u3002</p> <p>Signal \u63d0\u4f9b\u7aef\u5c0d\u7aef\u52a0\u5bc6\uff0c\u8a0a\u606f\u53ea\u6709\u767c\u9001\u8005\u8207\u63a5\u6536\u8005\u80fd\u95b1\u8b80\uff0c\u4f3a\u670d\u5668\u7121\u6cd5\u89e3\u5bc6\uff0c\u9084\u652f\u63f4\u8a0a\u606f\u81ea\u52d5\u92b7\u6bc0\u8207\u7981\u6b62\u622a\u5716\uff0c\u8b93\u901a\u8a0a\u5b89\u5168\u63d0\u5347\u5230\u53e6\u4e00\u5c64\u3002</p> <p>\u5c0f\u660e\u4e00\u6b65\u6b65\u6559\u670b\u53cb\u4e0b\u8f09\u4e26\u4f7f\u7528 Signal\uff0c\u78ba\u4fdd\u654f\u611f\u5c0d\u8a71\u4e0d\u88ab\u76e3\u63a7\u3002</p> <ul> <li>\u89d2\u8272\uff1a\u4f5c\u70ba\u4e00\u500b\u9700\u8981\u4fdd\u8b77\u901a\u8a0a\u96b1\u79c1\u7684\u975e\u71df\u5229\u7d44\u7e54\u5de5\u4f5c\u8005\uff0c  </li> <li>\u9700\u6c42\uff1a\u6211\u9700\u8981\u4e00\u500b\u63d0\u4f9b\u7aef\u5c0d\u7aef\u52a0\u5bc6\u4e14\u5b89\u5168\u7684\u901a\u8a0a\u5de5\u5177\uff0c  </li> <li>\u7406\u7531\uff1a\u4ee5\u78ba\u4fdd\u6a5f\u654f\u5c0d\u8a71\u4e0d\u88ab\u76e3\u63a7\u6216\u88ab\u622a\u53d6\uff0c\u63d0\u9ad8\u6211\u5011\u7684\u5b89\u5168\u9632\u8b77\u3002</li> </ul>"},{"location":"story.html#_6","title":"\u5b89\u5168\u50b3\u8f38\u5927\u6a94\u6848\uff0c\u907f\u514d\u654f\u611f\u8cc7\u6599\u5916\u6d29","text":"<p>\u5c0f\u660e\u548c\u4ed6\u7684\u5718\u968a\u9700\u8981\u5c07\u4e00\u4efd\u5305\u542b\u5927\u91cf\u654f\u611f\u500b\u4eba\u8cc7\u6599\u7684\u5831\u544a\uff0c\u5f9e\u4e00\u500b\u8fa6\u516c\u5ba4\u5b89\u5168\u5730\u50b3\u8f38\u5230\u53e6\u4e00\u500b\u4f4d\u65bc\u504f\u9060\u5730\u5340\u7684\u5408\u4f5c\u5925\u4f34\u3002\u9019\u4efd\u5831\u544a\u6a94\u6848\u975e\u5e38\u5927\uff0c\u900f\u904e\u96fb\u5b50\u90f5\u4ef6\u50b3\u9001\u4e0d\u65b9\u4fbf\uff0c\u4f7f\u7528\u96f2\u7aef\u786c\u789f\u53c8\u64d4\u5fc3\u8cc7\u6599\u5728\u50b3\u8f38\u6216\u5132\u5b58\u904e\u7a0b\u4e2d\u88ab\u7b2c\u4e09\u65b9\u76e3\u63a7\u6216\u622a\u53d6\u3002</p> <p>\u4ed6\u5011\u66fe\u7d93\u5617\u8a66\u904e\u4e00\u4e9b\u5e38\u898b\u7684\u6a94\u6848\u5206\u4eab\u670d\u52d9\uff0c\u4f46\u7e3d\u89ba\u5f97\u4e0d\u5920\u5b89\u5fc3\uff0c\u7279\u5225\u662f\u7576\u8cc7\u6599\u6d89\u53ca\u53d7\u8feb\u5bb3\u7fa4\u9ad4\u7684\u8eab\u4efd\u8cc7\u8a0a\u6642\uff0c\u4efb\u4f55\u4e00\u9ede\u6d29\u6f0f\u90fd\u53ef\u80fd\u5e36\u4f86\u56b4\u91cd\u5f8c\u679c\u3002</p> <p>\u9019\u6642\uff0c\u5c0f\u660e\u60f3\u8d77\u4e86 Magic Wormhole\u3002\u9019\u6b3e\u5de5\u5177\u5141\u8a31\u4ed6\u5011\u900f\u904e\u4e00\u500b\u7c21\u77ed\u7684\u300c\u5bc6\u78bc\u300d\u6216\u300c\u87f2\u6d1e\u78bc\u300d\uff0c\u76f4\u63a5\u5728\u5169\u53f0\u96fb\u8166\u4e4b\u9593\u5efa\u7acb\u52a0\u5bc6\u9023\u7dda\uff0c\u5b89\u5168\u5730\u50b3\u8f38\u4efb\u610f\u5927\u5c0f\u7684\u6a94\u6848\u548c\u8cc7\u6599\u593e\u3002\u8cc7\u6599\u5728\u50b3\u8f38\u904e\u7a0b\u4e2d\u662f\u7aef\u5230\u7aef\u52a0\u5bc6\u7684\uff0c\u4e0d\u6703\u7d93\u904e\u4efb\u4f55\u7b2c\u4e09\u65b9\u4f3a\u670d\u5668\uff0c\u5927\u5927\u964d\u4f4e\u4e86\u88ab\u76e3\u63a7\u6216\u622a\u53d6\u7684\u98a8\u96aa\u3002</p> <p>\u5c0f\u660e\u6307\u5c0e\u5408\u4f5c\u5925\u4f34\u5728\u4ed6\u5011\u7684\u96fb\u8166\u4e0a\u5b89\u88dd\u4e86 Magic Wormhole\uff0c\u7136\u5f8c\u4ed6\u8f38\u5165\u4e86\u87f2\u6d1e\u78bc\uff0c\u6a94\u6848\u4fbf\u958b\u59cb\u5b89\u5168\u5730\u50b3\u8f38\u3002\u6574\u500b\u904e\u7a0b\u5feb\u901f\u3001\u7c21\u55ae\uff0c\u800c\u4e14\u6700\u91cd\u8981\u7684\u662f\uff0c\u4ed6\u5011\u77e5\u9053\u9019\u4e9b\u654f\u611f\u8cc7\u6599\u5728\u50b3\u8f38\u904e\u7a0b\u4e2d\u5f97\u5230\u4e86\u6700\u9ad8\u7b49\u7d1a\u7684\u4fdd\u8b77\u3002</p> <ul> <li>\u89d2\u8272\uff1a\u4f5c\u70ba\u4e00\u500b\u9700\u8981\u5b89\u5168\u50b3\u8f38\u654f\u611f\u8cc7\u6599\u7684\u975e\u71df\u5229\u7d44\u7e54\u5de5\u4f5c\u8005</li> <li>\u9700\u6c42\uff1a\u6211\u9700\u8981\u4e00\u500b\u5b89\u5168\u3001\u9ad8\u6548\u4e14\u4e0d\u4f9d\u8cf4\u7b2c\u4e09\u65b9\u4f3a\u670d\u5668\u7684\u65b9\u5f0f\u4f86\u50b3\u8f38\u5927\u6a94\u6848</li> <li>\u7406\u7531\uff1a\u4ee5\u78ba\u4fdd\u654f\u611f\u8cc7\u6599\u5728\u50b3\u8f38\u904e\u7a0b\u4e2d\u4e0d\u88ab\u76e3\u63a7\u6216\u6d29\u6f0f\uff0c\u4fdd\u8b77\u53d7\u52a9\u8005\u7684\u96b1\u79c1\u548c\u5b89\u5168\u3002</li> </ul>"},{"location":"story.html#_7","title":"\u7d50\u8a9e\uff1a\u6280\u8853\u4e0d\u96e3\uff0c\u7fd2\u6163\u66f4\u91cd\u8981","text":"<p>\u5f9e\u521d\u671f\u4e0d\u614e\u66b4\u9732\u8eab\u5206\uff0c\u5230\u5b78\u6703\u7528 Tor Browser \u96b1\u85cf\u771f\u5be6 IP\uff0c\u518d\u5229\u7528 PrivateBin \u52a0\u5bc6\u5206\u4eab\uff0c\u6700\u5f8c\u4f7f\u7528 Signal \u4fdd\u8b77\u901a\u8a0a\uff0c\u5c0f\u660e\u4e00\u6b65\u6b65\u5efa\u7acb\u8d77\u5168\u9762\u7684\u6578\u4f4d\u9632\u8b77\u3002</p> <p>\u9019\u4e9b\u5de5\u5177\u5c0d\u975e\u6280\u8853\u80cc\u666f\u7684\u4eba\u4f86\u8aaa\u4e26\u4e0d\u9059\u9060\uff0c\u990a\u6210\u4f7f\u7528\u7684\u7fd2\u6163\uff0c\u624d\u80fd\u771f\u6b63\u4fdd\u969c\u81ea\u5df1\u548c\u5925\u4f34\u7684\u5b89\u5168\u3002</p> <p>\u5982\u679c\u4f60\u4e5f\u95dc\u5fc3\u81ea\u7531\u8207\u4eba\u6b0a\uff0c\u5f9e\u4f7f\u7528 Tor Browser \u958b\u59cb\uff0c\u662f\u4fdd\u8b77\u533f\u540d\u8207\u884c\u52d5\u5b89\u5168\u7684\u7b2c\u4e00\u6b65\u3002\u5176\u4ed6\u5de5\u5177\u5247\u5e6b\u52a9\u4f60\u5728\u8cc7\u8a0a\u5206\u4eab\u8207\u6e9d\u901a\u4e0a\u66f4\u52a0\u5b89\u5168\u3002</p>"},{"location":"tool_comparison.html","title":"\u5de5\u5177\u6bd4\u8f03","text":"<p>\u9019\u88e1\u5c07\u653e\u7f6e\u5de5\u5177\u6bd4\u8f03\u7684\u5167\u5bb9\u3002</p>"},{"location":"tool_list_category.html","title":"\u5de5\u5177\u6e05\u55ae\uff08\u4f9d\u985e\u5225\uff09","text":"<p>\u9019\u88e1\u5c07\u653e\u7f6e\u4f9d\u985e\u5225\u5206\u985e\u7684\u5de5\u5177\u6e05\u55ae\u5167\u5bb9\u3002</p>"},{"location":"tool_list_name.html","title":"\u5de5\u5177\u6e05\u55ae\uff08\u4f9d\u540d\u7a31\uff09","text":"<p>\u9019\u88e1\u5c07\u653e\u7f6e\u4f9d\u540d\u7a31\u5206\u985e\u7684\u5de5\u5177\u6e05\u55ae\u5167\u5bb9\u3002</p>"}]}